    console.log('---------------------------');
    console.log('File Removed');
    console.log('---------------------------');
  };

  function onComplete(data){
      console.log(data);
  }

    return (
        <>
            <div>
        <CSVReader
            onError={handleOnError}
            addRemoveButton
